import React from "react";
import "./SearchList.css";

const SearchList = (props) => {
  return (
    <div className="container">
      <div className="search-list">
        {props.search.map((search) => {
          return <div className="row"></div>;
        })}
      </div>
    </div>
  );
};

export default SearchList;
